    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1946.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and fires during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and raptors- is also
    covered. The Refuge development and maintenance section discusses physical developments
    and plantings. Resource management is discussed; topics include fur harvesting.
    The public relations section of the report describes Refuge visitors and violations.
    N-R forms and narrative reports on Clear Lake National Wildlife Refuge, Upper Klamath
    National Wildlife Refuge, and Lower Klamath National Wildlife Refuge are attached.",nt"license_title":
